import { Carousel } from 'antd';
import '../css/main.css'

 const Photo = () => {
  return (
    <Carousel autoplay>
      <div>
        <h3 style={{ backgroundColor: '#364d79', color: '#fff', height:  320, lineHeight: ' 320px', textAlign: 'center' }}>1</h3>
      </div>
      <div>
        <h3 style={{ backgroundColor: '#364d79', color: '#fff', height:  320, lineHeight: ' 320px', textAlign: 'center' }}>2</h3>
      </div>
      <div>
        <h3 style={{ backgroundColor: '#364d79', color: '#fff', height:  320, lineHeight: ' 320px', textAlign: 'center' }}>3</h3>
      </div>
      <div>
        <h3 style={{ backgroundColor: '#364d79', color: '#fff', height:  320, lineHeight: ' 320px', textAlign: 'center' }}>4</h3>
      </div>
    </Carousel>
  )
};
 export default Photo;
